<p>Металлоконструкции арочного типа низкого профиля из листовой стали отличаются от полуциркульных тем, что обладают большей площадью сечения при одинаковой высоте. Незамкнутые низкопрофильные стальные арочные МГК предназначены для использования на скальных и твердых грунтах с опорами, если это необходимо для сохранения естественного вида протока.</p>
<p>Конструкции 381х142 мм обладают необходимым запасом прочности при правильном выборе толщины листа в зависимости от высоты насыпи. Диапазон толщины стенок незамкнутых арочных МГК низкопрофильных 5–8 мм.</p>
<p>Конструкции 381х140 мм предназначены для использования в дорожном строительстве, прокладке коммуникаций, оборудовании переходов и тоннелей, скотопрогонных участков и других подземных систем с насыпями средней и большой высоты.</p>
